column13:
The present invention relates to an apparatus for introducing a water treatment material into a water supply, comprising: 
a mixing chamber having an fluid inlet in fluid communication with a source of water to be treated, a fluid outlet, and a dispensing inlet; 
a pumping device having an inlet in fluid communication with the fluid outlet of the mixing chamber and having an outlet in fluid communication with the water supply; a dispenser containing at least one unit dose of a solid or liquid water treatment material, in solid or liquid communication with the dispensing inlet of the mixing chamber.

